import Navbar from './components/navbar';

function App() {
  return (
    <div style={{ background: 'linear-gradient(to bottom, #ffffff 0%, #e1f3fc 66.346%)', minHeight: '100vh' }}>
      <Navbar />
      <div style={{ marginTop: '99px', padding: '20px' }}>
        <h1>Frontend</h1>
        <p>Welcome to your React app!</p>
      </div>
    </div>
  );
}

export default App;
